import React from 'react';
import { Router, Route, NavLink } from 'react-router-dom'
import Map from './Map'
import Homepage from './Homepage'
import { Navbar, Nav, Form, FormControl, Button } from 'react-bootstrap';

class Navigation extends React.Component {
    render() {
        return(
            <div>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand><b>Hikr</b></Navbar.Brand>
                <Nav className="mr-auto">

                <NavLink to="/home" component={Homepage}>Home</NavLink>
                {/* <NavLink exact path="/hikingtrails" component={Map}>Hiking Trails</NavLink> */}
                {/* <NavLink exact path="/profile">Profile</NavLink> */}
                </Nav>
                {/* <NavLink exact path="/login">Login</NavLink> */}
            </Navbar>
            <br />
            </div>
        )
    }
}

export default Navigation
